import * as React from "react";
import { useState, useEffect, useRef } from "react";
import styled from "styled-components";

import { createTheme, ThemeProvider } from "@mui/material/styles";
import Select from "@mui/material/Select";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";

import { era, genre, takePhoto, artMovement, orient, free } from "./Tags";
import TagsCheckBox from "./TagsCheckBox";
import HorizontalLine from "../layout/HorizontalLine";
import IdToShow from "./IdToShow";
import PostTemplate from "../post/PostTemplate";

const SearchContainer = styled.div`
  display: flex;
  align-items: center;
`;

const ShowContent = styled.div`
  text-align: left;
  font-size: 40px;
  font-weight: bold;
  // line-height: 1.2px;
  padding: 6px 0 0 18px;
  color: white;
  font-family: "Happiness-Sans-Title", sans-serif;
`;

const Box = styled.div`
  algin-item: left;
  width: 100%;
  margin: 0 auto;
  padding: 5px 5px 0px 5px;
`;

const SelectArea = styled.div`
  margin-left: auto;
  margin-right: 15px;
  margin-top: 10px;
`;

const darkTheme = createTheme({
  palette: {
    mode: "dark", // Set the theme mode to dark
  },
});

function HashTag({ selectedHashtag }) {
  const [selectedItems, setSelectedItems] = useState([]);
  const [selectedPhoto, setSelectedPhoto] = useState([]);
  const [selectedOrient, setSelectedOrient] = useState([]);
  const [selectedGenre, setSelectedGenre] = useState([]);
  const [selectedEra, setSelectedEra] = useState([]);
  const [selectedArtMovement, setSelectedArtMovement] = useState([]);
  const [selectedFree, setSelectedFree] = useState([]);

  const [selectedValue, setSelectedValue] = useState("1");
  const prevSelectedValueRef = useRef(selectedValue);

  const handleCheckedPhoto = (items) => {
    setSelectedPhoto(items);
  };
  const handleCheckedOrient = (items) => {
    setSelectedOrient(items);
  };
  const handleCheckedGenre = (items) => {
    setSelectedGenre(items);
  };
  const handleCheckedEra = (items) => {
    setSelectedEra(items);
  };
  const handleCheckedArtMovement = (items) => {
    setSelectedArtMovement(items);
  };
  const handleCheckedFree = (items) => {
    setSelectedFree(items);
  };

  useEffect(() => {
    const storedSelectedValue = localStorage.getItem("selectedValue");
    if (storedSelectedValue) {
      setSelectedValue(storedSelectedValue);
    }
  }, []);
  useEffect(() => {
    setSelectedItems((prevSelectedItems) => {
      const items = [
        ...selectedPhoto,
        ...selectedOrient,
        ...selectedGenre,
        ...selectedEra,
        ...selectedArtMovement,
        ...selectedFree,
      ];
      const orderedItmes = items.sort((a, b) => a - b);
      return orderedItmes;
    });
  }, [
    selectedPhoto,
    selectedOrient,
    selectedGenre,
    selectedEra,
    selectedArtMovement,
    selectedFree,
  ]);

  const { shows, tags } = IdToShow({
    TagItems: selectedItems,
    selectedValue: selectedValue,
  });
  return (
    <>
      <Box>
        <HorizontalLine />
        <TagsCheckBox
          title={"무료 전시회"}
          items={free}
          handleCheckedItems={handleCheckedFree}
          tags={tags}
        />
        <HorizontalLine />
        <TagsCheckBox
          title={"촬영 가능 여부"}
          items={takePhoto}
          handleCheckedItems={handleCheckedPhoto}
          tags={tags}
        />

        <HorizontalLine />
        <TagsCheckBox
          title={"지역별"}
          items={orient}
          handleCheckedItems={handleCheckedOrient}
          tags={tags}
        />
        <HorizontalLine />
        <TagsCheckBox
          title={"장르별"}
          items={genre}
          handleCheckedItems={handleCheckedGenre}
          tags={tags}
        />
        <HorizontalLine />
        <TagsCheckBox
          title={"시대별"}
          items={era}
          handleCheckedItems={handleCheckedEra}
          tags={tags}
        />
        <HorizontalLine />
        <TagsCheckBox
          title={"미술사조"}
          items={artMovement}
          handleCheckedItems={handleCheckedArtMovement}
          tags={tags}
        />
        <HorizontalLine />
        <ThemeProvider theme={darkTheme}>
          <SearchContainer>
            <ShowContent>Exhibitions</ShowContent>
            <SelectArea>
              <FormControl>
                <Select
                  value={selectedValue} // Use the selectedValue state here
                  onChange={(event) => setSelectedValue(event.target.value)} // Update the selectedValue state
                  size="small"
                  variant="outlined"
                  color="primary"
                >
                  <MenuItem value="1">최신순</MenuItem>
                  <MenuItem value="2">마감순</MenuItem>
                </Select>
              </FormControl>
            </SelectArea>
          </SearchContainer>
        </ThemeProvider>
        {shows && <PostTemplate shows={shows} />}
      </Box>
    </>
  );
}

export default React.memo(HashTag);
